css:
atom-pane-container {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
}
atom-pane-container atom-pane-axis {
  display: -webkit-flex;
  -webkit-flex: 1;
}
atom-pane-container atom-pane-axis > atom-pane-resize-handle {
  position: absolute;
  z-index: 3;
}
atom-pane-container atom-pane-axis.vertical {
  -webkit-flex-direction: column;
}
atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  width: 100%;
  height: 8px;
  margin-top: -4px;
  cursor: row-resize;
  border-bottom: none;
}
atom-pane-container atom-pane-axis.horizontal {
  -webkit-flex-direction: row;
}
atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  width: 8px;
  height: 100%;
  margin-left: -4px;
  cursor: col-resize;
  border-right: none;
}
atom-pane-container atom-pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
  overflow: visible;
  min-width: 0;
}
atom-pane-container atom-pane .item-views {
  -webkit-flex: 1;
  display: -webkit-flex;
  min-height: 0;
  min-width: 0;
  position: relative;
}
atom-pane-container atom-pane .item-views .pane-item {
  color: #273a3f;
  background-color: #e6eeef;
}
atom-pane-container atom-pane .item-views > *,
atom-pane-container atom-pane .item-views > atom-text-editor.react > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
.platform-win32 atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  cursor: ns-resize;
}
.platform-win32 atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  cursor: ew-resize;
}
